function instantiateRelationships(l, v){
//Create Object-Array relationships for improved performance
  let allItemsPackage = {
    allItems: [],
    convBin2Text: [],
    convBin2Index: []
  };
  
  allItemsPackage.allItems = allItemsPackage.allItems.concat(
    prefixType[l].version[v].comms, 
    allChars, 
    prefixType[l].version[v].capitalizedEnglishWords, 
    prefixType[l].version[v].englishWords, 
    prefixType[l].version[v].suffx
  );

    let indx = [];
    for (let i = 0; i < allItemsPackage.allItems.length; i++){
      indx[i] = i;
    };
    
    allItemsPackage.convBin2Text = binary13.reduce((prev, item, i) => {
    prev[item] = {
      text: allItemsPackage.allItems[i]
    }
    return prev;
  }, {});

    allItemsPackage.convBin2Index = binary13.reduce((prev, item, i) => {
      prev[item] = {
        index: indx[i]
      }
      return prev;
    }, {});
    
    allItemsPackage.convAllChars2Index = allChars.reduce((prev, item, i) => {
      prev[item] = {
        index: indx[i]
      }
      return prev;
    }, {});
    return allItemsPackage;
  };















